Due to unruly precipitation harshing our good times, we are EXTENDING RESTAURANT WEEK TO MARCH 1st!! (A wholly better month anyway IMHO)

Head over to MSPMAG.COM for more details and to see which restaurants opted in for the extension. But know that it includes @thebungalowclubmpls 
@broderscucina 
@thelexmn 
@yumissushi 
@masonjarkitchenandbar 
@osdistillingco 
@smackshacktc 
@bookclubrestaurant 
