And many more!!

So hunker if ya hafta, better days and great deals still ahead! 🥃🥩🥨🥢🥣🥦🥪🥟🥫🥡🌭🥥🌮🌯🥧🍔🍓🍜🍝🍞🍕🍖🍟🍠🍘🍿🍩🍨🍦🍪🥑🥐🥗🥔🥓🥒🥞🥖🥕🥝🥜🥚🦐

The @mnstatefair in three days and three gets: 

// THURSDAY NEW GET: The Holey Hamloaf from @hamlinechurchdininghall is my FAVE ♥️ new food! Come on, griddled brekkie sandwich of hamloaf with cheese and an egg?! One of the oldest booths jumps to the front as the new hotness. Couldn't have come from a nicer crew, too.

// FRIDAY SECRET GET: The Produce Exchange @px_at_msf has a killer hidden menu item! Verbal the Hot Peach Parfait and get this grilled peach with cream, crunchy bits, and Cooper's hibiscus lime hot sauce. It more than SLAPS. 

// SATURDAY STANDARD GET: Fried bologna sandwich with hot sauce and mayo from Netterfield's concessions by the kidway. When I can finally eat what I want. ♥️

After 38K steps, taking Sunday off, but I'll be back on Monday when the lines chill back! #mnstatefair (hamloaf pic: @caitabrams )
